import React from 'react'
import LinkIcon from '../../components/icons/LinkIcon'
import CheckboxInput from '../../components/ui/CheckboxInput'
import useFormContext from '../../Hooks/useFormContext'

const AgreementsInfo = () => {
  const { userData, handleChange, commonInputSetContainerClasses, commonStepFormContainerClasses } = useFormContext()

  const mlhCoCLabelText = <span className='whitespace-pre-wrap'>
    I have read and agree to the MLH Code of Conduct, which can be found at <a
      href="https://static.mlh.io/docs/mlh-code-of-conduct.pdf" target="_blank" rel="noopener noreferrer"
      className='text-sky-600'> <span> MLH Code of Conduct</span><LinkIcon width="13" height="13" strokeColor="rgb(2 132 199)" className="inline align-bototm mx-2" /></a >
  </span>

  return (
    <div className={commonStepFormContainerClasses}>
      <CheckboxInput containerClass="flex flex-row"
        labelClass="normal-case text-base text-slate-700"
        inputClass="inline w-min mr-4"
        labelText={mlhCoCLabelText}
        fieldName="mlhCoCAgree"
        fieldValue={userData.firstName}
        handleChange={handleChange}
      />
    </div>
  )
}

export default AgreementsInfo
